Using HashCode in .NETFramework
So, I just learned that not even in .net472/net48, you can leverage the cool HashCode type from .NETCore. It is mentioned in docs as available in ".NET Platform Extensions 3.1", which isn't quite clear what it means. After a quick search here and there, I found out the Microsoft.Bcl.HashCode package, which seems to be one such ".NET platform extension" (although the version # doesn't match either :/).
With that, I can now make a KeyValuePairComparerto check for dictionaries equality like:
    public class KeyValuePairComparer : IEqualityComparer>
    {
        public static KeyValuePairComparer Default { get;} = new KeyValuePairComparer();

        public bool Equals(KeyValuePair x, KeyValuePair y) => object.Equals(x.Key, y.Key) && object.Equals(x.Value, y.Value);

        public int GetHashCode(KeyValuePair obj) => HashCode.Combine(obj.Key, obj.Value);
    }

To be used as: 
IReadOnlyDictionary first = ...
IReadOnlyDictionary second = ...

return first.SequenceEquals(second, KeyValuePairComparer.Default);

